"use strict";(self.webpackChunkdocs_fintesk_com=self.webpackChunkdocs_fintesk_com||[]).push([[2882],{78215:a=>{a.exports=JSON.parse('{"tag":{"label":"Importing data","permalink":"/es/tags/importing-data","allTagsPath":"/es/tags","count":11,"items":[{"id":"kb/importing-data/how-can-i-format-dates-to-import-into-fintesk","title":"\xbfC\xf3mo puedo formatear las fechas para importar a Fintesk?","description":"Fintesk admite m\xfaltiples formatos y configuraciones de fecha.Al importar sus propias fechas en cualquier campo del tipo Fecha, hay algunas cosas a tener en cuenta:","permalink":"/es/kb/importing-data/how-can-i-format-dates-to-import-into-fintesk"},{"id":"kb/importing-data/why-do-my-imported-currency-values-appear-as-0","title":"\xbfPor qu\xe9 mis valores de moneda importados aparecen como \\"0\\"?","description":"Al importar desde hojas de c\xe1lculo, aseg\xfarese de que todos los valores monetarios (para campos predeterminados, como el valor del negocio, y para cualquier campo personalizado donde tenga monedas) est\xe9n formateados como n\xfameros sin s\xedmbolos de moneda (as\xed que 1000000000 en lugar de $ 1000000000).","permalink":"/es/kb/importing-data/why-do-my-imported-currency-values-appear-as-0"},{"id":"kb/importing-data/changing-the-field-type-of-a-custom-field","title":"Cambiar el tipo de campo de un campo personalizado","description":"La mejor manera de cambiar el tipo de un campo personalizado es recrear el campo en el tipo que desea y usar la funci\xf3n Fintesk \\"ID del sistema\\" para transferir los datos existentes al nuevo campo.","permalink":"/es/kb/importing-data/changing-the-field-type-of-a-custom-field"},{"id":"kb/importing-data/import-fields","title":"Import fields","description":"Cuando importa hojas de c\xe1lculo en Fintesk, es importante saber en qu\xe9 campos est\xe1n disponibles para que usted mueva los datos de la hoja de c\xe1lculo.","permalink":"/es/kb/importing-data/import-fields"},{"id":"kb/importing-data/importing-mandatory-fields","title":"Importaci\xf3n-> campos obligatorios","description":"Al importar datos a Fintesk desde una hoja de c\xe1lculo, es importante incluir los campos que son obligatorios para que cada elemento se importe con \xe9xito. Este art\xedculo lo lleva a trav\xe9s de los cuales los campos son obligatorios para la importaci\xf3n.","permalink":"/es/kb/importing-data/importing-mandatory-fields"},{"id":"kb/importing-data/importing-advanced-mapping","title":"Importaci\xf3n-> Mapeo avanzado","description":"Al importar en Fintesk, algunos campos pueden ser m\xe1s complicados para mapear su hoja de c\xe1lculo dependiendo de c\xf3mo se configuren los campos. Los campos de m\xfaltiples opciones, direcci\xf3n y tipo de tel\xe9fono requieren un paso adicional para que se asignen correctamente.","permalink":"/es/kb/importing-data/importing-advanced-mapping"},{"id":"kb/importing-data/importing-mapping-your-fields","title":"Importaci\xf3n-> Mapeo de sus campos","description":"Para que usted importe sus datos hacia Fintesk correctamente, deber\xe1 asignar las columnas de su hoja de c\xe1lculo a los campos en Fintesk. De esta manera, puede asegurarse de que sus personas de contacto, organizaciones, negocios, actividades, notas o productos se importen correctamente con sus datos relevantes.","permalink":"/es/kb/importing-data/importing-mapping-your-fields"},{"id":"kb/importing-data/importing-sample-import-spreadsheets","title":"Importaci\xf3n-> Muestra de hojas de c\xe1lculo de importaci\xf3n","description":"Si necesita ayuda con su Importaci\xf3n de datos hacia Fintesk, Es posible que desee comenzar con un documento de plantilla para ver la mejor manera de proceder.","permalink":"/es/kb/importing-data/importing-sample-import-spreadsheets"},{"id":"kb/importing-data/importing-data-into-fintesk-with-spreadsheets","title":"Importar datos a Fintesk con hojas de c\xe1lculo","description":"Puede importar sus datos a Fintesk desde archivos de hoja de c\xe1lculo XLS, XLSX y CSV, lo que le permite agregar negocios, organizaciones, persona, productos, notas and actividades todo al mismo tiempo.","permalink":"/es/kb/importing-data/importing-data-into-fintesk-with-spreadsheets"},{"id":"kb/importing-data/transferring-data-to-a-different-fintesk-company-account","title":"Transferring data to a different Fintesk company account","description":"Importando y exportando sus datos","permalink":"/es/kb/importing-data/transferring-data-to-a-different-fintesk-company-account"},{"id":"kb/importing-data/updating-fintesk-data-with-a-spreadsheet","title":"Updating Fintesk data with a spreadsheet","description":"Tener una gran base de datos de negocios, personas o cualquier otro elemento puede ser natural al administrar sus ventas. Sin embargo, se puede esperar que alguna informaci\xf3n se vuelva anticuada con el tiempo. Actualizar cada uno de ellos manualmente es factible, pero si hay mucha informaci\xf3n que debe actualizarse, puede requerir un tiempo y un esfuerzo importantes que podr\xeda estar utilizando para concretar las negocios y sus ventas.","permalink":"/es/kb/importing-data/updating-fintesk-data-with-a-spreadsheet"}],"unlisted":false}}')}}]);